    Node {
            weight: N,
        },
    Edge {
            source: usize,
            target: usize,
            weight: E,
        },
}

fn bellman_ford<G>(G, G::NodeId)
-> Result<Paths<G::NodeId, G::EdgeWeight>, NegativeCycle> where G: NodeCount +
IntoNodeIdentifiers + IntoEdges + NodeIndexable, G::EdgeWeight: FloatMeasure

fn dijkstra<G, F, K>(G, G::NodeId, Option<G::NodeId>, F)
-> HashMap<G::NodeId, K> where G: IntoEdges + Visitable, G::NodeId: Eq + Hash,
F: FnMut(G::EdgeRef) -> K, K: Measure + Copy

fn dag_to_toposorted_adjacency_list<G, Ix, '_>(G, &'_ [G::NodeId])
-> (UnweightedList<Ix>, Vec<Ix>) where Ix: IndexType, G: GraphBase +
IntoNeighborsDirected + NodeCompactIndexable + NodeCount, G::NodeId: IndexType

fn toposort<G, '_>(G, Option<&'_ mut DfsSpace<G::NodeId, G::Map>>)
-> Result<Vec<G::NodeId>, Cycle<G::NodeId>> where G: IntoNeighborsDirected +
IntoNodeIdentifiers + Visitable

fn has_path_connecting<G,
'_>(G, G::NodeId, G::NodeId, Option<&'_ mut DfsSpace<G::NodeId, G::Map>>)
-> bool where G: IntoNeighbors + Visitable

fn run<G, F, '_>(&'_ mut Self, G, F) where G: IntoNodeIdentifiers<NodeId =
N> + IntoNeighbors<NodeId = N> + NodeIndexable<NodeId = N>,
F: for<'_> FnMut(&'_ [N]) -> (), N: Copy + PartialEq

fn min_spanning_tree<G>(G) -> MinSpanningTree<G> where G::NodeWeight: Clone,
G::EdgeWeight: Clone + PartialOrd, G: IntoNodeReferences +
IntoEdgeReferences + NodeIndexable

fn index_twice_mut<T, U, '_>(&'_ mut Self, T, U)
-> (&'_ mut <Self as Index<T>>::Output, &'_ mut <Self as Index<U>>::Output)
where Self: IndexMut<T> + IndexMut<U>, T: GraphIndex, U: GraphIndex

fn from_edges<I>(I) -> Self where I: IntoIterator,
I::Item: IntoWeightedEdge<E>,
<I::Item as IntoWeightedEdge<E>>::NodeId: Into<NodeIndex<Ix>>, N: Default

fn extend_with_edges<I, '_>(&'_ mut Self, I) where I: IntoIterator,
I::Item: IntoWeightedEdge<E>,
<I::Item as IntoWeightedEdge<E>>::NodeId: Into<NodeIndex<Ix>>, N: Default

fn complement<N, E, Ty, Ix, '_,
'_>(&'_ Graph<N, E, Ty, Ix>, &'_ mut Graph<N, E, Ty, Ix>, E) where
Ty: EdgeType, Ix: IndexType, E: Clone, N: Clone
